// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

import "./SyndicateClosedEndFundLogic.sol";
import "./interfaces/ISyndicateClosedEndFundAllowlistLogicV0.sol";

/// @author Syndicate Inc.
/// @notice This contract enables the manager to enable/disable, add members
/// to, and remove members from the allowlist. If the allowlist is enabled,
/// then only the listed addresses will be allowed to deposit.

contract SyndicateClosedEndFundAllowlistLogicV0 is
    ISyndicateClosedEndFundAllowlistLogicV0,
    SyndicateClosedEndFundLogic
{
    // Storage------------------------------------------------------------------

    /// @notice Used to initialize the Syndicate contract.
    constructor(address owner, address storeAddress)
        SyndicateClosedEndFundLogic(owner, storeAddress)
    {}

    // Events-------------------------------------------------------------------

    /// @notice A manager enables or disables the allowlist.
    /// @dev These events can be used to notify prospective members off-chain
    /// whether membership is restricted or not.
    event AllowlistEnabledUpdated(
        address indexed syndicateAddress,
        bool indexed allowlistEnabled
    );

    /// @notice A manager adds a member's wallet address to the allowlist.
    /// @dev These events can be used to notify a member off-chain that their
    /// address is now allowed
    /// @dev The timestamp is not critical here and in the below events, so it
    /// is not included to save on gas costs. When a timestamp is necessary, it
    /// can be pulled by evaluating the block that an event was contained in
    /// (since the timestamp is just the block.timestamp)
    event AddressAllowed(
        address indexed syndicateAddress,
        address indexed memberAddress
    );

    /// @notice A manager removes a member's wallet address from the allowlist.
    /// @dev These events can be used to notify a member off-chain that their
    /// address is now blocked (e.g. removed from the allowlist)
    event AddressBlocked(
        address indexed syndicateAddress,
        address indexed memberAddress
    );

    // Functions----------------------------------------------------------------

    /// @notice Used by a manager to turn the allowlist on or off
    /// @param syndicateAddress The address of the Syndicate
    /// @param allowlistEnabled True if the Syndicate ONLY accepts deposits
    /// from allowed addresses. False if any (accredited) member can make a
    /// deposit.
    /// @notice This setter can only be called when the Syndicate is open, as
    /// it only limits future deposits. To retroactively remove deposits that
    /// have been made by members who may not have been on the allowlist, a
    /// manager should use `managerRejectDepositForMember()`.
    function managerSetAllowlistEnabled(
        address syndicateAddress,
        bool allowlistEnabled
    ) public override onlyManager(syndicateAddress) onlyOpen(syndicateAddress) {
        store.setAllowlistEnabled(syndicateAddress, allowlistEnabled);
        // Emit an event when the manager modifies the allowlist settings
        emit AllowlistEnabledUpdated(syndicateAddress, allowlistEnabled);
    }

    /// @notice Used by a manager to add an array of member addresses to the
    /// allowlist and emit an event to allow for easy searching.
    /// @param syndicateAddress The address of the Syndicate to accept the
    /// allowedAdresses
    /// @param memberAddresses An array of addresses to be allowed by the
    /// Syndicate
    /// @notice This function is only relevant when the manager has turned the
    /// allowlist on (`SyndicateValues.allowlistEnabled == true`). If the
    /// allowlist is off, anyone can make a deposit to the Syndicate without the
    /// manager specifically allowing their address.
    /// @dev Allowing a single address costs 31527 in gas without an array and
    /// 32445 in gas with an array. This is a difference in cost of $0.17 at
    /// current gas prices, which is a worthwhile trade off considering that (a)
    /// allowing only one address will be less common than allowing multiple
    /// addresses and (b) having two different allowAddress functions poses a
    /// security risk if we forget to reconcile changes between them
    function managerAllowAddresses(
        address syndicateAddress,
        address[] calldata memberAddresses
    )
        public
        override
        onlyManager(syndicateAddress)
        onlyOpen(syndicateAddress)
        onlyAllowlistEnabled(syndicateAddress)
    {
        // Loop through all memberAddresses and change status to True for allowed.
        for (uint256 i = 0; i < memberAddresses.length; i++) {
            store.setAllowlist(syndicateAddress, memberAddresses[i], true);
            // Emit an event that a member can listen to so that they can know
            // when their address has been added to an allowlist
            emit AddressAllowed(syndicateAddress, memberAddresses[i]);
        }
    }

    /// @notice Used by a manager to remove a previously-allowed member address
    /// from the allowlist
    /// @param syndicateAddress The address of the Syndicate that contains the
    /// allowlist
    /// @param memberAddresses The array of member addresses to remove.
    /// @notice This function only proceeds when the allowlist is enabled, as
    /// it is ineffective to maintain a blocklist of possible member addresses.
    /// A manager who wishes to reverse a deposit into their fund should
    /// instead use `managerRejectDepositForMembers()`.
    /// @notice Blocking a member address that has previously been allowed does
    /// not reject or return their prior deposits. The deposit is still kept
    /// in the syndicate.
    function managerBlockAddresses(
        address syndicateAddress,
        address[] calldata memberAddresses
    )
        public
        override
        onlyManager(syndicateAddress)
        onlyOpen(syndicateAddress)
        onlyAllowlistEnabled(syndicateAddress)
    {
        for (uint256 i = 0; i < memberAddresses.length; i++) {
            store.setAllowlist(syndicateAddress, memberAddresses[i], false);

            emit AddressBlocked(syndicateAddress, memberAddresses[i]);
        }
    }
}

